import "./expenseApp.css";
function ExpenseApp(title, date, amount) {
  return (
    <div className="expense-item">
      <div>{date}</div>
      <div className="expense-item__description">
        <h2>{title}</h2>
        <div className="expense-item__price">{amount}}</div>
      </div>
    </div>
  );
}

export default ExpenseApp;
